    def find(parent, i):
        if parent[i] == i:
            return i
        return find(parent, parent[i])

    def union(parent, rank, x, y):
        xroot = find(parent, x)
        yroot = find(parent, y)

        if xroot == yroot:
            return False

        if rank[xroot] < rank[yroot]:
            parent[xroot] = yroot
        elif rank[xroot] > rank[yroot]:
            parent[yroot] = xroot
        else:
            parent[yroot] = xroot
            rank[xroot] += 1
        return True

    def kruskal(n, edges):
        parent = [i for i in range(n + 1)]
        rank = [0] * (n + 1)
        result = []

        for e in sorted(edges, key=lambda x: x[2]):
            if union(parent, rank, e[0], e[1]):
                result.append(e)
                if len(result) == n - 1:
                    break
        return result

