    special_offers = []
    for _ in range(m):
        x, y, w = map(int, stdin.readline().split())
        special_offers.append((x - 1, y - 1, w))

    def kruskal(n, a, edges):
        parent = [i for i in range(n)]
        rank = [0] * n

        def find(u):
            if u == parent[u]:
                return u
            parent[u] = find(parent[u])
            return parent[u]

        def union(u, v):
            pu, pv = find(u), find(v)
            if pu == pv:
                return False
            if rank[pu] > rank[pv]:
                parent[pv] = pu
            else:
                parent[pu] = pv
                if rank[pu] == rank[pv]:
                    rank[pv] += 1
            return True

        edges.sort(key=lambda e: e[2])
        total_cost = 0
        for e in edges:
            u, v, w = e
            if union(u, v):
                total_cost += w
        return total_cost

    edges = [(i, j, a[i] + a[j]) for i in range(n) for j in range(i + 1, n)]
    edges.extend(special_offers)
    return str(kruskal(n, a, edges))

