    visited = [False] * (n + 1)
    cycles = []

    def dfs(node, parent, cycle):
        visited[node] = True
        cycle.append(node)

        for neighbor in adjacency_list[node]:
            if not visited[neighbor]:
                if dfs(neighbor, node, cycle):
                    return True
            elif neighbor != parent:
                cycle_length = len(cycle)
                backtrack = len(cycle) - cycle.index(neighbor) - 1
                if cycle_length > 2 and backtrack > 1:
                    return True

        cycle.pop()
        return False

    for i in range(1, n + 1):
        if not visited[i]:
            cycle = []
            dfs(i, None, cycle)
            if cycle:
                cycles.append(cycle)

    result = 0
    for cycle in cycles:
        if len(cycle) > 2:
            result += 1

    return str(result)

