    def kruskal(n, m, edges):
        parent = [i for i in range(n)]
        rank = [0] * n
        mst_cost = 0
        mst_edges = []

        for edge in sorted(edges, key=lambda x: x[2]):
            u, v, w = edge
            if union(parent, rank, u - 1, v - 1):
                mst_cost += w
                mst_edges.append(edge)

        return mst_cost, mst_edges

    def unify_mst(n, m, edges, k):
        mst_cost, mst_edges = kruskal(n, m, edges)
        if mst_cost != k:
            return -1

        mst_edges.sort(key=lambda x: x[2], reverse=True)
        for edge in mst_edges:
            u, v, w = edge
            if w > 1:
                w_new = w - 1
            else:
                w_new = w + 1

            edges_new = [e for e in edges if e != edge]
            edges_new.append((u, v, w_new))

            mst_cost_new, _ = kruskal(n, m, edges_new)
            if mst_cost_new == k:
                return 1
