    def find(parent, u):
        if parent[u] == u:
            return u
        parent[u] = find(parent, parent[u])
        return parent[u]

    def union(parent, rank, x, y):
        xroot = find(parent, x)
        yroot = find(parent, y)

        if xroot == yroot:
            return

        if rank[xroot] < rank[yroot]:
            parent[xroot] = yroot
        elif rank[xroot] > rank[yroot]:
            parent[yroot] = xroot
        else:
            parent[yroot] = xroot
            rank[xroot] += 1

    def kruskal(n, edges):
        parent = [i for i in range(n)]
        rank = [0] * n
        mst_cost = 0
        edge_index = 0

        while edge_index < len(edges) and len(set(parent)) > 1:
            u, v, w = edges[edge_index]
            edge_index += 1

            if find(parent, u) != find(parent, v):
                mst_cost += w
                union(parent, rank, u, v)

        return mst_cost if len(set(parent)) == 1 else float('inf')

    def dijkstra(start, n, graph):
        dist = [float('inf')] * (n + 1)
        dist[start] = 0
        hq = [(0, start)]

        while hq:
            d, u = heapq.heappop(hq)

            if d > dist[u]:
                continue

            for v, w in graph[u]:
                if dist[u] + w < dist[v]:
                    dist[v] = dist[u] + w
                    heapq.heappush(hq, (dist[v], v))

        return dist

    def min_cost(n, m, k, edges, couriers):
        min_cost = float('inf')
        min_zero = -1

        for i in range(m):
            x, y, w = edges[i]
            edges[i] = (x, y, 0)
            cost = kruskal(n, edges)
            if cost != float('inf'):
