            edges[min_zero] = (x, y, 0)
            cost = kruskal(n, edges)
            if cost != float('inf'):
                cost += sum(dijkstra(a_i, n, couriers)[b_i] for a_i, b_i in couriers)
                min_cost = min(min_cost, cost)

        return min_cost

