        new_board = [row[:] for row in board]
        for i in range(len(piece)):
            for j in range(len(piece[0])):
                if piece[i][j] == 1:
                    if not is_valid(new_board, x + j, y + i):
                        return None
                    new_board[y + i][x + j] = 1
        return new_board

