    matrix = []
    key = ''.join(set(key_phrase.replace(' ', '')) - set('q'))
    key = (key + 'abcdefghijklmnoprstuvwxyz')[:25]
    for i in range(0, 25, 5):
        matrix.append(list(key[i:i+5]))

    # Remove spaces and duplicate characters from the plaintext
    plaintext = plaintext.replace(' ', '')
    plaintext = ''.join(ch for ch in plaintext if ch.isalpha())

    # Apply the Playfair cipher rule to encrypt the plaintext
    encrypted = ''
    i = 0
    while i < len(plaintext):
        if i + 1 == len(plaintext):
            plaintext += 'x'
        bigram = plaintext[i:i+2]
        if bigram[0] == bigram[1]:
            bigram = bigram[0] + 'x' + bigram[1:]
        else:
            row1, col1 = divmod(matrix[0].index(bigram[0]), 5)
            row2, col2 = divmod(matrix[0].index(bigram[1]), 5)
            if row1 == row2:
                encrypted_bigram = matrix[row1][(col1 + 1) % 5] + matrix[row2][(col2 + 1) % 5]
            elif col1 == col2:
                encrypted_bigram = matrix[(row1 + 1) % 5][col1] + matrix[(row2 + 1) % 5][col2]
            else:
                encrypted_bigram = matrix[row1][col2] + matrix[row2][col1]
        encrypted += encrypted_bigram
        i += 2

    return encrypted.upper()

